import React from 'react';
import QuoteList from '../components/quotes/QuoteList'


const DUMMY_QUOTES = [
    {id: 'q1', author: 'Max', text: 'Learning is fun.'},
    {id: 'q2', author: 'Max2', text: 'Learning React is fun.'},
]

const AllQuotes = () => {
    return (
        <div>
            <h1>All Quotes Pages</h1>
        </div>
    );
};

export default AllQuotes;
